import styled from "styled-components";

const Action = ({label, onClickFunc, itemId, itemObj}) => {
    return <Button onClick={() => onClickFunc(itemObj)}
                   id={itemId}>{label}</Button>
}

export default Action;

const Button = styled.button`
    width: 100px;
    height: 50px;
`
